;$(document).on('orViewLoaded',function(e,r){$(e.target).find('.qrcode').click(function(){let wrapper=$('<div class="qrcode-wrapper"></div>');$('div#dialog > .view').append(wrapper);$('div#dialog').removeClass('is-closed').addClass('is-open');var e=$(this).attr('data-qrcode');$(wrapper).qrcode({render:'div',text:e,fill:'currentColor'});wrapper.attr('title',e);$('div#dialog > .view').fadeIn()})});